INSERT INTO `programs` (`id`, `category`, `title`, `progatext`, `progatest`, `progatemplate`, `input`, `output`, `f_in`, `f_out`, `code`) VALUES
(43, 'Оператор розгалуження', 'Визначити, чи є число а дільником', 'Визначити, чи є число а дільником числа b або, навпаки, число b дільником числа а. відповіддю повинні слугувати повідомлення: “Так, одне із чисел є дільником другого” або “Ні, жодне з чисел не є дільником другого”.', '', 'as', '2 4', 'Так, одне із чисел є дільником другого', '8 4', 'Так, одне із чисел є дільником другого', 0),
(44, 'Оператор розгалуження', 'Найбільше з двох', 'Напришіть програму яка буде вивидити найбільше з двох чисел', '', 'ів', '6 4', '6', '8 10', '10', 0),
(45, 'Оператор розгалуження', 'Рівносторонній трикутник', 'Визначити, чи є трикутник зі сторонами a, b, c рівностороннім. Вивести або \"yes\" або \"no\".', '', 'ів', '6 8 8', 'no', '4 4 4', 'yes', 0),
(46, 'Оператор циклу', 'Обчислення суми чисел', 'Завдання: Напишіть програму, яка знаходить суму перших n натуральних чисел.\r\nУточнення: Натуральні числа - це цілі числа, починаючи з 1.', '', 'q', '3', '6', '5', '15', 0),
(47, 'Оператор циклу', 'Множення чисел', 'Завдання: Напишіть програму, яка обчислює добуток перших n натуральних чисел.\r\nУточнення: Натуральні числа - це цілі числа, починаючи з 1.', '', 'q', '3', '6', '5', '120', 3245),
(48, 'Оператор циклу', 'Квадрати чисел', 'Завдання: Напишіть програму, яка виводить квадрати перших n натуральних чисел.\r\nУточнення: Натуральні числа - це цілі числа, починаючи з 1.', '', 'q', '3', '1 4 9', '5', '1 4 9 16 25', 3245),
(49, 'Оператор циклу', 'Факторіал', 'Завдання: Напишіть програму, яка обчислює факторіал числа n.\r\nУточнення: Факторіал числа n - це добуток всіх цілих чисел від 1 до n включно.', '', 'q', '3', '6', '5', '120', 3245),
(50, 'Оператор циклу', 'Сума діапазону', 'Завдання: Напишіть програму, яка знаходить суму всіх цілих чисел у діапазоні від a до b.\r\nУточнення: a і b - цілі числа, причому b >= a.', '', 'q', '3 6', '18', '-2 2', '0', 3245),
(51, 'Оператор циклу', 'Перевірка на простоту', 'Завдання: Напишіть програму, яка перевіряє, чи є число n простим.\r\nУточнення: Просте число - це натуральне число, яке має лише два дільники: 1 і саме число.', '', 'q', '7', 'yes', '10', 'no', 0),
(52, 'Оператор циклу', 'Парні числа', 'Завдання: Напишіть програму, яка виводить всі парні числа від 1 до n.\r\nУточнення: Парне число - це число, яке ділиться на 2 без остачі.', '', 'q', '10', '2 4 6 8 10', '15', '2 4 6 8 10 12 14', 0),
(53, 'Оператор циклу', 'Квадрати парних чисел', 'Завдання: Напишіть програму, яка виводить квадрати всіх парних чисел від 1 до n.\r\nУточнення: Парне число - це число, яке ділиться на 2 без остачі.', '', 'q', '6', '4 16 36', '8', '4 16 36 64', 0),
(56, 'Оператор розгалуження', 'Перевірка на парність', 'Завдання: Напишіть програму, яка перевіряє, чи є введене користувачем число парним або непарним.', '', '', '4', 'Число 4 є парним.', '7', 'Число 7 є непарним.', 0),
(57, 'Оператор циклу', 'Сумма чисел', 'Завдання: Напишіть програму, яка обчислює суму чисел від 1 до n.', '', '', '5', 'Введіть число: Відповідь: 15', '10', 'Введіть число: Відповідь: 55', 0),
(58, 'Оператор циклу', 'Таблиця множення', 'Завдання: Напишіть програму, яка виводить таблицю множення для заданого числа n.', '', '', '3', 'Таблиця множення для числа 3: 3 * 1 = 3\n3 * 2 = 6\n3 * 3 = 9\n', '5', 'Таблиця множення для числа 5: 5 * 1 = 5\n5 * 2 = 10\n5 * 3 = 15\n5 * 4 = 20\n5 * 5 = 25\n', 0),
(59, 'Оператор циклу', 'Факторіал', 'Завдання: Напишіть програму, яка обчислює факторіал числа n.', '', '', '4', 'Факторіал числа 4: 4! = 24', '6', 'Факторіал числа 6: 6! = 720', 0),
(60, 'Оператор циклу', 'Парні числа', 'Завдання: Напишіть програму, яка виводить перші n парних чисел.', '', '', '3', 'Перші 3 парних чисел: 2 4 6', '5', 'Перші 5 парних чисел: 2 4 6 8 10', 0),
(61, 'Оператор циклу', 'Трикутник', 'Завдання: Напишіть програму, яка виводить трикутник зі зірочок.', '', '', '5', '*\n**\n***\n****\n*****\n', '3', '*\n**\n***\n', 0),
(62, 'Оператор циклу', 'Квадрат', 'Завдання: Напишіть програму, яка виводить квадрат зі зірочок.', '', '', '4', '****\n****\n****\n****\n', '6', '******\n******\n******\n******\n******\n******\n', 0),
(63, 'Оператор циклу', 'Прості числа', 'Завдання: Напишіть програму, яка виводить перші n простих чисел.', '', '', '5', 'Перші 5 простих чисел: 2 3 5 7 11', '3', 'Перші 3 простих чисел: 2 3 5', 0),
(64, 'Оператор циклу', 'Фібоначчі', 'Завдання: Напишіть програму, яка генерує перші n чисел Фібоначчі.', '', '', '5', 'Перші 5 чисел Фібоначчі: 0 1 1 2 3', '7', 'Перші 7 чисел Фібоначчі: 0 1 1 2 3 5 8', 0),
(65, 'Оператор циклу', 'Середнє арифметичне', 'Завдання: Напишіть програму, яка знаходить середнє арифметичне набору чисел.', '', '', '2 4 6 4', 'Середнє арифметичне: 4', '1 3 5 7', 'Середнє арифметичне: 4', 0),
(66, 'Оператор циклу', 'Сума парних', 'Завдання: Напишіть програму, яка знаходить суму перших n парних чисел.', '', '', '3', 'Сума перших 3 парних чисел: 12', '5', 'Сума перших 5 парних чисел: 30', 0),
(67, 'Оператор розгалуження', 'Перевірка числа на додатність', 'Завдання: Напишіть програму, яка перевіряє, чи є введене користувачем число додатнім.', '', '', '4', 'Число 4 є додатнім.', '-7', 'Число -7 не є додатнім.', 0),
(68, 'Оператор розгалуження', 'Перевірка на парність', 'Завдання: Напишіть програму, яка перевіряє, чи є введене користувачем число парним або непарним.', '', '', '4', 'Число 4 є парним.', '7', 'Число 7 є непарним.', 0),
(69, 'Оператор розгалуження', 'Перевірка на кратність 5', 'Завдання: Напишіть програму, яка перевіряє, чи є введене користувачем число кратним 5.', '', '', '10', 'Число 10 кратне 5.', '13', 'Число 13 не кратне 5.', 0),
(70, 'Оператор розгалуження', 'Перевірка на простоту', 'Завдання: Напишіть програму, яка перевіряє, чи є введене користувачем число простим.', '', '', '7', 'Число 7 є простим.', '8', 'Число 8 не є простим.', 0),
(71, 'Оператор розгалуження', 'Перевірка на кратність 3 та 5', 'Завдання: Напишіть програму, яка перевіряє, чи є введене користувачем число кратним одночасно 3 та 5.', '', '', '15', 'Число 15 кратне 3 та 5.', '8', 'Число 8 не кратне 3 та 5.', 0),
(72, 'Оператор розгалуження', 'Перевірка на ділення на 3 або 5', 'Завдання: Напишіть програму, яка перевіряє, чи ділиться введене користувачем число на 3 або на 5 без остатку.', '', '', '9', 'Число 9 ділиться на 3 або на 5 без остатку.', '14', 'Число 14 не ділиться на 3 або на 5 без остатку.', 0),
(73, 'Оператор розгалуження', 'Перевірка на квадрат числа', 'Завдання: Напишіть програму, яка перевіряє, чи є введене користувачем число квадратом іншого числа.', '', '', '9', 'Число 9 є квадратом числа.', '14', 'Число 14 не є квадратом числа.', 3245),
(74, 'Оператор розгалуження', 'Перевірка на ділення на 7 та 11', 'Завдання: Напишіть програму, яка перевіряє, чи є введене користувачем число кратним одночасно 7 та 11.', '', '', '77', 'Число 77 кратне 7 та 11.', '60', 'Число 60 не кратне 7 та 11.', 3245),
(75, 'Оператор розгалуження', 'Перевірка на ділення на 2, 3 та 5', 'Завдання: Напишіть програму, яка перевіряє, чи є введене користувачем число кратним одночасно 2, 3 та 5.', '', '', '30', 'Число 30 кратне 2, 3 та 5.', '21', 'Число 21 не кратне 2, 3 та 5.', 3245),
(76, 'Оператор розгалуження', 'Перевірка на ділення на 9 або 11', 'Завдання: Напишіть програму, яка перевіряє, чи ділиться введене користувачем число на 9 або на 11 без остатку.', '', '', '99', 'Число 99 ділиться на 9 без остатку.', '55', 'Число 55 не ділиться на 9 або на 11 без остатку.', 3245),
(77, 'Оператор розгалуження', 'Перевірка на чотирьохзначність', 'Завдання: Напишіть програму, яка перевіряє, чи є введене користувачем число чотирьохзначним.', '', '', '1000', 'Число 1000 є чотирьохзначним.', '999', 'Число 999 не є чотирьохзначним.', 3245),
(78, 'Оператор розгалуження', 'Перевірка на кратність суми', 'Завдання: Напишіть програму, яка перевіряє, чи є введене користувачем число кратним сумі його цифр.', '', '', '14', 'Сума цифр числа 14 дорівнює 5, а саме число не кратне 5.', '18', 'Сума цифр числа 18 дорівнює 9, а саме число кратне 9.', 0),
(79, 'Оператор розгалуження', 'Перевірка на рівність цифр', 'Завдання: Напишіть програму, яка перевіряє, чи є всі цифри введеного користувачем числа рівними.', '', '', '333', 'У числі 333 всі цифри рівні.', '202', 'У числі 202 не всі цифри рівні.', 0),
(80, 'Оператор розгалуження', 'Пошук діапазону числа', 'Завдання: Напишіть програму, яка визначає, в якому діапазоні знаходиться введене користувачем число (від 0 до 10, від 11 до 20, або вище 20).', '', '', '18', 'Число 18 знаходиться у діапазоні від 11 до 20.', '3', 'Число 3 знаходиться у діапазоні від 0 до 10.', 0),
(81, 'Оператор розгалуження', 'Перевірка на повну дільність', 'Завдання: Напишіть програму, яка перевіряє, чи ділиться введене користувачем число на суму його цифр без остатку.', '', '', '18', 'Число 18 ділиться на суму його цифр без остатку.', '17', 'Число 17 не ділиться на суму його цифр без остатку.', 0),
(82, 'Оператор розгалуження', 'Перевірка на рівність сум цифр', 'Завдання: Напишіть програму, яка перевіряє, чи рівні суми цифр двох введених користувачем чисел.', '', '', '27 63', 'Сума цифр першого числа (27) дорівнює 9, сума цифр другого числа (63) дорівнює 9, суми цифр рівні.', '45 99', 'Сума цифр першого числа (45) дорівнює 9, сума цифр другого числа (99) дорівнює 18, суми цифр не рівні.', 0),
(83, 'Оператор розгалуження', 'Пошук найменшої цифри', 'Завдання: Напишіть програму, яка знаходить найменшу цифру введеного користувачем числа.', '', '', '278', 'Найменша цифра числа 278 дорівнює 2.', '456', 'Найменша цифра числа 456 дорівнює 4.', 0),
(84, 'Оператор розгалуження', 'Перевірка на ділення на 4 та 6', 'Завдання: Напишіть програму, яка перевіряє, чи ділиться введене користувачем число на 4 та 6 без остатку.', '', '', '24', 'Число 24 ділиться на 4 та 6 без остатку.', '21', 'Число 21 не ділиться на 4 та 6 без остатку.', 0),
(85, 'Оператор розгалуження', 'Перевірка на квадрат і куб числа', 'Завдання: Напишіть програму, яка перевіряє, чи є введене користувачем число квадратом або кубом.', '', '', '64', 'Число 64 є квадратом числа.', '8', 'Число 8 є кубом числа.', 0),
(86, 'Оператор розгалуження', 'Перевірка на паліндром', 'Завдання: Напишіть програму, яка перевіряє, чи є введене користувачем число паліндромом.', '', '', '1221', 'Число 1221 є паліндромом.', '1234', 'Число 1234 не є паліндромом.', 0),
(89, 'Лінійні вирази', 'Обчислення середнього', 'Завдання: Напишіть програму, яка обчислює середнє арифметичне двох чисел.', '', '', '4 7', 'Середнє арифметичне чисел 4 і 7 дорівнює 5.5', '3 9', 'Середнє арифметичне чисел 3 і 9 дорівнює 6', 0),
(95, 'Лінійні вирази', 'Обчислення середнього значення', 'Завдання: Напишіть програму, яка обчислює середнє значення набору чисел.', '', '', '3 7 9 1', 'Середнє значення чисел 3, 7, 9, 1 дорівнює 5.0', '2 4 6 8', 'Середнє значення чисел 2, 4, 6, 8 дорівнює 5', 0),
(102, 'Лінійні вирази', 'Дуже проста программа', '<p>Написати програму, яка рахує суму двох чисел...<br><br><strong>Наприклад,</strong> ви вводете <strong>4</strong> та <strong>7</strong> ... вам виводе число <strong>11</strong> без усілякого зайвого тексту<br><br></p>', '', 'іва', '5 8', '13', '7 9', '16', 0),
(104, 'Лінійні вирази', 'Рівняння', '<p>Написати програму, яка знаходить <em><strong>y</strong></em> при заданому значенні <em><strong>x<br><img src=\"data:image/png;base64,\"><br></strong></em></p>', '', 'import os\r\nos.system(\'cls\')\r\nfrom math import *\r\n\r\n\r\nx = int(input())\r\n\r\nz = 2*x + 5\r\n\r\ny = (sqrt(x + z) + 5 * x * z) / x**2\r\n\r\nprint(y)', '3', '18.74907304297488', '5', '15.178885438199984', 0),
(108, 'Лінійні вирази', 'Разряди  числа', '<p>Напишіть&nbsp; програму яка знаходить різницю між цифрами разрядів двозначного числа<br>Наприклад ви вводите 83<br>Программа вам виводе 5</p>\r\n<p>Тоб то&nbsp; 8&nbsp; &nbsp;-&nbsp; &nbsp;3</p>', '', 'import os\r\nos.system(\'cls\')\r\nfrom math import *\r\n\r\n\r\na = int(input())\r\n\r\nx1 = a % 10\r\nx2 = a // 10\r\n\r\nsumm = x2 - x1\r\n\r\nprint(summ)\r\n\r\n\r\n', '74', '3', '95', '4', 3245),
(109, 'Лінійні вирази', 'Просте рівняння', '<p>Напишіть програму яка буде розвязувате наступне рівняння:</p>\r\n<p><img src=\"data:image/png;base64,\"></p>\r\n<p>Змінна \"а\" вводится з клавіатури... Треба порахувати \"у\"</p>', '', 'a = int(input())\r\n\r\nx = (5+a)/a\r\n\r\ny = (3*x - 5*a - 3)/(2*x)\r\n\r\nprint(y)', '6', '-7.5', '5', '-5.5', 3245);
INSERT INTO `programs` (`id`, `category`, `title`, `progatext`, `progatest`, `progatemplate`, `input`, `output`, `f_in`, `f_out`, `code`) VALUES
(110, 'Лінійні вирази', 'Рівняння з коренем', '<p>Напишіть програму яка розвязує рівняння:</p>\r\n<p><img src=\"data:image/png;base64,\"></p>\r\n<p>Змінна \"а\" вводиться з клавіатури, треба знайти \"у\"</p>', '', 'a = int(input())\r\nfrom math import *\r\n\r\nx = sqrt(a)\r\n\r\ny = x**2 + a\r\n\r\nprint(y)', '25', '50.0', '9', '18.0', 3245);
